import React from 'react'

const UserPage = () => {
    return(
        <div>
            <ul>
                {["Warren", "Mina", "Jigar"].map((user, idx) => {
                    return <li key={idx}>{user}</li>
                })}
            </ul>
        </div>
    )
}

export default UserPage
